import React from 'react';
import "./SongRow.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faList } from '@fortawesome/free-solid-svg-icons';
import { faCircleRight } from '@fortawesome/free-solid-svg-icons';
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import { faCheck } from '@fortawesome/free-solid-svg-icons';
import { faArrowRotateRight } from '@fortawesome/free-solid-svg-icons';
import { faArrowDownLong } from '@fortawesome/free-solid-svg-icons';


const SongRow = ({ song }) => {
  return (
    <div className='obshi'>
      <div className='xosqi'>
        <div>11111</div>
        <div>11111</div>
        <div>11111</div>
      </div>
       <div className="song-row">
          <span><FontAwesomeIcon icon={faList} /><FontAwesomeIcon icon={faCircleRight} /></span>
          <span className='data-item'><h4>{song.songName}</h4></span>
          <span className='data-item'><h4>{song.artistName}</h4></span>
          <span className='data-item'><h4>{song.trackNumber}</h4></span>
          <span>
            <FontAwesomeIcon icon={faHeart} />
            <FontAwesomeIcon icon={faCheck} />
            <FontAwesomeIcon icon={faArrowRotateRight} />
            <FontAwesomeIcon icon={faArrowDownLong} />
            </span>
      {/* Add more song details as needed */}
      
    </div>
    
    </div>
   
  );
}

export default SongRow;
